def load_image_as_base64(image_path: str) -> str:
    """
    从文件加载图片并转换为 base64
    
    Args:
        image_path: 图片文件路径
        
    Returns:
        base64 编码的字符串
    """
    with open(image_path, 'rb') as f:
        image_data = f.read()
        return base64.b64encode(image_data).decode('utf-8')


